$.dN=function(){var s=t.N
return A.aG(["about","Sobre Mi","aboutInfo1","Soy un desarrollador de software cuyo sue\xf1o es mejorar el mundo mediante la tecnolog\xeda. Me gusta aprender nuevas tecnolog\xedas y crear proyectos; sin embargo, mi enfoque est\xe1 en el desarrollo Frontend. Crear interfaces de usuario es algo que me apasiona y disfruto haci\xe9ndolo. Tambi\xe9n me gusta el desarrollo Backend, ya que tienes el control sobre c\xf3mo se manejan los datos del software.","aboutInfo2","En mi tiempo como desarrollador, me he enfocado en el desarrollo m\xf3vil, creando aplicaciones para Android e iOS utilizando Flutter y React Native. He sido responsable de crear la interfaz de usuario (UI) y conectarla mediante el uso de APIs","experienceF","En esta empresa, desarroll\xe9 las interfaces de usuario en Flutter y React Native para proyectos internos y externos, utilizando la arquitectura MVC con Redux y Provider para el manejo de estados. Adem\xe1s, utilic\xe9 Singletons para el manejo de las APIs","experienceU","En la Universidad Aut\xf3noma de Baja California, desarroll\xe9 proyectos de escala profesional junto con mis compa\xf1eros, utilizando tecnolog\xedas tanto en el Frontend como en el Backend. Entre ellas se incluyen Flutter con Provider, C# con .NET y Entity Framework, y SQL Server. Adem\xe1s, tuve experiencia en el manejo de bases de datos en la nube con Azure","hernotes1","HerNotes es un proyecto orientado a la psicolog\xeda que consiste en una aplicaci\xf3n m\xf3vil con diferentes roles de usuario: doctor y paciente. En esta aplicaci\xf3n, el paciente tiene un diario donde puede registrar sus pensamientos y algunas notas que el doctor le haya dejado. La peculiaridad radica en que cada nota incluye una lista de emociones basada en el \xe1rbol de emociones de Plutchik. El paciente puede seleccionar las emociones que experimenta en ese momento, y el doctor puede ver las emociones que el paciente ha seleccionado en cada nota. Esto permite al doctor obtener un mejor entendimiento de c\xf3mo se siente el paciente.","hernotes2","Asimismo, hay una secci\xf3n de estad\xedsticas donde se presentan las notas del paciente con sus respectivas emociones, las cuales est\xe1n calificadas con un valor num\xe9rico para facilitar la clasificaci\xf3n y buscar siempre la homogeneidad de las emociones m\xe1s intensas. Adem\xe1s, se muestra el contenido de la nota y las anotaciones del doctor.","hernotes3","El proyecto est\xe1 hecho con Flutter para la interfaz de usuario, utilizando Provider para la gesti\xf3n de estados, y C# con .NET para el backend. Se emplea una base de datos SQL Server y Entity Framework para la administraci\xf3n de la base de datos, y se ha implementado en Azure.","cimaboy1","CimaBoy fue un proyecto presentado en la Universidad con el objetivo de familiarizar a los ni\xf1os con las tecnolog\xedas emergentes que est\xe1n cada vez m\xe1s arraigadas en nuestro tiempo actual, como la inteligencia artificial. La idea era que los ni\xf1os pudieran hacer preguntas al chatbot sobre qu\xe9 era, c\xf3mo funcionaba o cualquier duda que tuvieran al respecto. El experimento fue exitoso, ya que los ni\xf1os mostraron un gran inter\xe9s en el chatbot y en su funcionamiento. Se les explic\xf3 de manera simple y comprensible para ellos","cimaboy2","El proyecto est\xe1 desarrollado con Flutter para la interfaz de usuario, utilizando Provider para la gesti\xf3n de estados. Se utiliz\xf3 la API de OpenAI, espec\xedficamente el modelo Whisper, para transcribir el audio a texto. Adem\xe1s, se emple\xf3 el modelo GPT-3.5 - Turbo de OpenAI para generar respuestas para el usuario. Tambi\xe9n se utiliz\xf3 la API de ElevenLaps para convertir la respuesta de GPT-3.5 - Turbo a audio."],s,s)}()
$.dL=function(){var s=t.N
return A.aG(["about","About Me","aboutInfo1","I am a software developer whose dream is to make the world better through technology. I enjoy learning new technologies and creating projects; however, my focus is on Frontend development. Creating user interfaces is something I'm passionate about, and I love doing it. I also like Backend development as it gives you control over how the software's data is handled.","aboutInfo2","In my time as a developer, I have focused on mobile development, creating applications for Android and iOS using Flutter and React Native. I have been responsible for creating the user interface (UI) and connecting it through the use of APIs.","experienceF","At this company, I developed user interfaces in Flutter and React Native for internal and external projects, using the MVC architecture with Redux and Provider for state management. Additionally, I employed Singletons for handling APIs","experienceU","At the Universidad Aut\xf3noma de Baja California, I worked on professional-scale projects with my peers, using technologies in both Frontend and Backend. These included Flutter with Provider, C# with .NET and Entity Framework, and SQL Server. Additionally, I gained experience in managing cloud databases with Azure","hernotes1","HerNotes is a psychology-oriented project that involves a mobile application with different user roles: doctor and patient. In this application, the patient has a journal where they can record their thoughts and any notes left by the doctor. The uniqueness lies in each note having a list of emotions based on Plutchik's emotion tree. The patient can select the emotions they are experiencing at that moment, and the doctor can view the emotions selected by the patient for each note. This enables the doctor to gain a better understanding of the patient's emotional state.","hernotes2","Similarly, there is a statistics section that displays the patient's notes with their associated emotions, which are rated with a numerical value for ease of sorting and always seeking homogeneity among the highest emotions. The content of the note and the doctor's annotations are also shown.","hernotes3","The project is developed using Flutter for the user interface, employing Provider for state management, and C# with .NET for the backend. It utilizes a SQL Server database with Entity Framework for database management and has been deployed on Azure.","cimaboy1","CimaBoy was a project showcased at the university with the aim of introducing children to emerging technologies that are becoming increasingly prevalent in our current time, such as artificial intelligence. The concept was for children to ask the chatbot questions about what it was, how it worked, or any queries they had about it. The experiment was successful as the children showed a keen interest in the chatbot and its operation. The explanation was provided in a simple and understandable manner tailored for them.","cimaboy2","The project is built with Flutter for the user interface, using Provider for state management. The OpenAI API, specifically the Whisper model, was used to transcribe audio to text. Additionally, the OpenAI GPT-3.5 - Turbo model was employed to generate responses for the user. The ElevenLaps API was also used to convert the response from GPT-3.5 - Turbo to audio."],s,s)}()
